import React from 'react';
import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from 'react';

function App() {

  const [serverUrl, setServerUrl] = useState("https://localhost:9000/users");
  const [serverResponse, setServerResponse] = useState("");

  useEffect(()=>{
    fetch(serverUrl)
    .then((response:any) => response.text())
    .then((response:any) => setServerResponse(response));
  },[serverUrl,serverResponse]);

  return (
    <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
        <>{serverResponse}</>
    </div>
  );
}

export default App;
